INSERT INTO `Moq_article` (`id`, `cid`, `title`, `image`, `intro`, `content`, `browse`, `collect`, `sort`, `is_topping`, `is_recommend`, `is_show`, `is_delete`, `create_time`, `update_time`, `delete_time`) VALUES (1, 1, '0基础学PHP到底有多难', 'static/default/images/article01.jpg', '但是任何一门技术，如果轻易就能够让人学会，那也不会称作为技术，因为那样，工作的可替代性太强了技术，只有难学才会更有价值。对于零基础的同学来说，学习php肯定是非常需要毅力的，任何语言的学习都不可能一蹴而就，而是需要花大量时间，消耗大量精力才能学会的！', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p>PHP作为WEB端最佳的开发语言，没有华而不实，而是经受住了时间考验，是一门非常值得学习的编程语言。</p>\n<p>目前市场上各种网站、管理系统、小程序、APP等，基本都是使用PHP开发的，也侧面反映了PHP的需求以及学习的必要性！</p>\n<p>对于刚接触PHP的同学，作为过来人，这里分享一下PHP的一些学习经验！</p>\n<p>&nbsp;</p>\n<p><strong>一、学php难吗？</strong></p>\n<p>难！</p>\n<p>但是任何一门技术，如果轻易就能够让人学会，那也不会称作为技术，因为那样，工作的可替代性太强了技术，只有难学才会更有价值。对于零基础的同学来说，学习php肯定是非常需要毅力的，任何语言的学习都不可能一蹴而就，而是需要花大量时间，消耗大量精力才能学会的！</p>\n<p>&nbsp;</p>\n<p><strong>二、学php有没有技巧？</strong></p>\n<p>当然有，这也是这篇文章想说明的</p>\n<p>&nbsp;</p>\n<ul>\n<li>\n<p><strong>php学习第一要点：心态</strong></p>\n</li>\n</ul>\n<p>虽然目前php语言市场火爆，而且php语言相对于其他语言来说也更容易学习，但是千万别把php想的太简单，不要全信培训学校的宣传，仿佛零基础的人分分钟钟，随随便便就将php学会。</p>\n<p>失败的案例肯定不少。</p>\n<p>当然我也不要把php想的太难，既然你想从事这方面的工作，那么就要准备全力以赴，破釜沉舟。3个月学会不会，那就坚持到4个月，4个月还不会，那就坚持到5个月（需要一点点乌龟精神），总有一天，会全面掌握php知识，拿到自己满意的薪酬。</p>\n<p>&nbsp;</p>\n<ul>\n<li>\n<p><strong>php学习的第二要点：就是学习方法</strong></p>\n</li>\n</ul>\n<p>这里，建议大家还是报一个班，比如php中文网，他们家也有线上直播班，口碑一直不错。</p>\n<p>一个人学习php太难，如果说有一群人一起来学习，就能够营造出一种学习php氛围，有老师教，学习php碰到问题也可以得到解决。</p>\n<p>这里，就会碰到一个问题，那就是一个班，有零基础的、有从事过这方面工作的，php水平可谓是层次不齐，如果是一个零基础的同学学习php，如何跟上学校的讲课进度？</p>\n<p>&nbsp;</p>\n<ul>\n<li>\n<p><strong>php学习的第三要点：那就是坚持、坚持、再坚持，抵御诱惑</strong></p>\n</li>\n</ul>\n<p>PHP是最适合新手入门学习的首选语言，但是很多新手刚接触编程无所适从，也许学了一半PHP，又开始打C#主意，或者有人说JA VA 很强，这个时候的绝对不能动摇，哪怕我真想学，也得学会了PHP然后再学。</p>\n<p>见异思迁，是最不可取的！狗熊掰玉米就是这个道理，如果经常中途放弃，只能是一无所获，还浪费了N多的时间和经历。当我花费了大量精力后却又放弃了php，相信心里面会很难过，对未来又会陷入到迷茫中，严重打击自信心。</p>\n<p>&nbsp;</p>\n<p><strong>三、如果不想有这种体验，那就坚持学会php吧！</strong></p>\n</body>\n</html>', 11, 0, 0, 1, 1, 1, 1, 1716170400, 1716170400, 1759389662);
INSERT INTO `Moq_article` (`id`, `cid`, `title`, `image`, `intro`, `content`, `browse`, `collect`, `sort`, `is_topping`, `is_recommend`, `is_show`, `is_delete`, `create_time`, `update_time`, `delete_time`) VALUES (2, 1, '28岁了打算入行PHP还来得及吗', 'static/default/images/article02.jpg', '来不来得及不用考虑，只要你技术学的扎实，找一份工作还是没问题。你要考虑的是转行成本：如果你现在只是拿着四五千的薪资，工作也没什么成长性，即使辞了这份工作，很容易也能找到差不多的，那你可以考虑入行PHP。', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p>来不来得及不用考虑，只要你技术学的扎实，找一份工作还是没问题。</p>\n<p><strong>你要考虑的是转行成本：</strong></p>\n<p>如果你现在只是拿着五六千的薪资，工作也没什么成长性，即使辞了这份工作，很容易也能找到差不多的，那你可以考虑入行PHP。</p>\n<p>虽然没有年龄上的优势，但是同样的，你在28岁这个年纪，就算转入任何一个行业皆是如此。</p>\n<p>就看你自己有没有破釜沉舟的决心，以及能不能抗住学习的压力和刚进公司的压力。</p>\n<p><strong>至少在目前迈进PHP行业的门槛并不高：</strong></p>\n<p>1、会一些简单的&nbsp;<code>HTML+CSS+JavaScript&nbsp;</code>就可以完成简单的页面布局；</p>\n<p>2、掌握基本的<code>PHP+MySQL</code>，学习如何将<code>PHP</code>与<code>前端</code>结合起来，完成简单的动态页面。</p>\n<p>3、学习一些主流前后端框架，比如<code>ThinkPHP</code>、<code>LayUI</code>，提升开发效率， 最终完成一个功能齐全的动态站点。</p>\n<p>&nbsp;</p>\n<p>另外这个行业并不是只能一开始就来，后来的都上不了车，不像医生，老师，律师，金融等行业一样，把车门都给你焊的死死的。</p>\n<p>&nbsp;</p>\n<p><strong>只要肯努力，多做项目，多学习，一年肯定能称得上别人三年的经验，成为 &ldquo; 后起之秀 &rdquo;！</strong></p>\n<p><strong>加油！</strong></p>\n</body>\n</html>', 6, 0, 0, 1, 1, 1, 1, 1716170400, 1716170400, 1759389658);
INSERT INTO `Moq_article` (`id`, `cid`, `title`, `image`, `intro`, `content`, `browse`, `collect`, `sort`, `is_topping`, `is_recommend`, `is_show`, `is_delete`, `create_time`, `update_time`, `delete_time`) VALUES (3, 1, '初中级的PHPer应该具备这些技能', 'static/default/images/article03.jpg', '又到了，金三银四，换工作季。我没准备换工作，倒是上网翻了翻招聘信息，由于我做PHP，就看了下当下3-5年的招聘需求，发现这些招聘信息都有如下要求', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p><strong>3-5年PHP需要具备：</strong></p>\n<ul>\n<li><code>TCP/UDP</code>协议，&nbsp;<code>socket</code>通信，熟练使用<code>workman</code>，<code>swoole</code>，<code>swoft</code>等rpc框架</li>\n<li>精通<code>PHP</code>，另外最好熟悉一门其他编程语言</li>\n<li>熟悉<code>html</code>，<code>css</code>，<code>javascript</code>，会<code>nodejs</code>，<code>vue</code>优先</li>\n<li><code>mysql</code>， 以及<code>SQL</code>优化，熟悉索引应用和优化，独立设计数据库、数据表</li>\n<li><code>nosql</code>，<code>mongodb</code>，&nbsp;<code>redis</code>，<code>memcache</code>缓存。熟悉后端缓存技术、了解缓存使用场景，高并发、高性能服务系统设计经验及能力，熟悉大规模集群系统的开发</li>\n<li>常用<code>Linux</code>，<code>shell</code>命令编写，熟悉云、容器使用</li>\n<li>精通<code>LNMP</code>架构，熟悉<code>http&nbsp;</code>协议，<code>RestFul API</code>开发，熟悉<code>tp</code>，<code>laravel</code>，<code>yii</code>主流框架。</li>\n<li>熟练使用<code>svn</code>，<code>git</code>，<code>Hg</code>版本管理工具，</li>\n<li>良好的书写习惯，注释，设计模式，编写高质量的，整洁简单，可维护性的代码，遵循公司研发规范，产品技术文档的整理</li>\n<li>分析和快速排查定位解决线上问题，保障系统功能的稳定性，优化现有系统，提升运作性能</li>\n<li>主导/参与项目的架构设计、技术选型、架构原型实现以及服务端核心模块的开发，与各技术人员紧密合作，完成工作任务</li>\n<li>有个人博客，个人开源项目，有个人独立完成项目。</li>\n<li>乐于持续学习，乐观开朗，抗压性强，良好的沟通能力和合作精神，自我驱动力强，有强烈的事业心和责任感</li>\n</ul>\n<p>大家可以看看自己是否达到了主流的用人标准，如果你是超出预期，那么你可以选择跳得更高。</p>\n<p>3-5年时间，足够把一个学生培养成一个合格的打工人了。可以看到企业还是把PHPer当作多面手看待，希望不仅需要精通PHP，还需要掌握前端和运维等方面的知识。对技术高低的评判主要是对高性能、高并发的设计，这个时候会不会用第三方工具（Redis，ES），了不了解限流、队列、削峰、缓存这些原理就尤为重要。</p>\n<p>3-5年的phper，企业还希望有一定的带团能力，由此可见phper的成熟期是较短的。</p>\n<p>我同时对比了3-5年的NodeJS，Python、Java、Golang就职要求，要求本科以上，至少4年以上经验，更侧重逻辑算法，门槛比较高。</p>\n<p>或许去年疫情情况，让很多人觉得PHP岗位是不是少了，其实疫情对于IT公司多少都有所影响，各个技术岗位裁员也是难免的，不过这些只是短暂的变动。</p>\n</body>\n</html>', 3, 0, 0, 1, 1, 1, 1, 1716170400, 1716170400, 1759389655);
INSERT INTO `Moq_article` (`id`, `cid`, `title`, `image`, `intro`, `content`, `browse`, `collect`, `sort`, `is_topping`, `is_recommend`, `is_show`, `is_delete`, `create_time`, `update_time`, `delete_time`) VALUES (4, 1, '别再学这五个要被淘汰的编程语言了', 'static/default/images/article04.jpg', '编程语言都有自己的生命周期，对某些语言来说，属于它们的时代似乎已经结束了，今天，我们就来盘下一下目前前景最黯淡的5种语言。', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p>每个编码的人都有自己喜欢的语言。拥有一种首选语言有很多原因，但是，我们的语言有时会变得很单调，它不再由制造它的公司维护，或者人们出于某种无法解释的原因放弃使用它。但是，也有的编程语言例外，比如C语言，它就经受住了时间的考验，在许多情况下仍然是最流行的编程语言。</p>\n<p>编程语言都有自己的生命周期，对某些语言来说，属于它们的时代似乎已经结束了，今天，我们就来盘下一下目前前景最黯淡的5种语言：</p>\n<p>&nbsp;</p>\n<p><strong>1. Visual Basic .NET</strong></p>\n<p>Microsoft Visual Basic.NET 是 Microsoft Visual Basic 6.0 的后续版本，它是基于 .NET 框架重新设计的，在1991年，微软增强了BASIC语言，将其包含到语言中，形成了Visual Basic，后来发生了一些事情：德尔福（Borland）的负责人安德斯&middot;海尔斯伯格（Anders Hejlsberg）离开了公司，加入了微软，在那里他开始了C#项目。</p>\n<p>这种语言在许多方面与Java相似，一段时间后，C#成为了微软的新语言标准。与c#诞生同时，微软程序员发明了VisualBasic . net，它的语法与BASIC相同，但代码模仿了C#。这两种语言都广为人知，但c#似乎赢得了流行度的竞赛。因此，Visual Basic似乎注定要消亡。</p>\n<p>&nbsp;</p>\n<p><strong>2.Delphi</strong></p>\n<p>Delphi，也就是Pascal + Objects，最有可能被淘汰，即便Embarcadero已经尝试支持它，新版本仍在发布中。这主要归结于Borland的一系列战略失误。</p>\n<p>首先，，他们把名字改成了Imprise。然而，这并没有起作用，于是又回到了之前的名字，并突然将他们的数据库工具从编程工具中分离出来。</p>\n<p>后者被重新命名为CodeGear，但出于某种原因，人们开始怀疑出了什么问题：如此频繁的名称更改，如此频繁的战略更改，让这门语言的拥护者离他而去。</p>\n<p>Embarcadero的持续努力是否能让Delphi继续下去还有待观察，但很明显Delphi在编程世界中正在失去青睐。也许是时候换一个不同的平台了。</p>\n<p>&nbsp;</p>\n<p><strong>3.Perl</strong></p>\n<p>曾经有一段时间，每个人都用Perl编程，但是后来发生了一些事情，开发者开始在不知道原因的情况下添加越来越大的功能，也许这增加了了问题的复杂性。甚至它的作者似乎已经含蓄地解释了Perl的一些问题，并选择停止从2000年开始的Perl 6开发，关键是，似乎现在也没人想要在用Perl。</p>\n<p>&nbsp;</p>\n<p><strong>4. Adobe Flash</strong></p>\n<p>我们这里讨论的不是语言，而是平台。当史蒂夫&middot;乔布斯选择不在苹果的移动设备上使用Adobe Flash时，Adobe Flash的丧钟就敲响了。</p>\n<p>如果其中一个新平台，比如苹果的平板电脑，不支持Flash应用程序，开发者将不得不使用Javascript、HTML5或其他苹果批准的平台来创建这些应用程序。结果，Flash尽管不断进步，却开始衰落。如今，它还是避免不了消亡。</p>\n<p>&nbsp;</p>\n<p><strong>5.Ruby</strong></p>\n<p>Ruby在大约10年前风靡一时，它在1995年首次亮相后就有了一大批的拥护者，很多人会拿Ruby和C类语言做比较。</p>\n<p>毫无疑问，这是一种非常棒的编程语言，尽管它的发展速度很慢，例如，Twitter有许多用Ruby构建的东西，但由于效率低下而放弃了它，而这一发现的那天很可能就是Ruby开始消亡的那天。</p>\n</body>\n</html>', 13, 0, 0, 1, 1, 1, 1, 1716170400, 1716170400, 1759389651);
INSERT INTO `Moq_article` (`id`, `cid`, `title`, `image`, `intro`, `content`, `browse`, `collect`, `sort`, `is_topping`, `is_recommend`, `is_show`, `is_delete`, `create_time`, `update_time`, `delete_time`) VALUES (5, 2, '怎么用php实现多对一通讯录', 'static/default/images/article05.jpg', '随着移动互联网的快速发展，人们使用手机和电脑联系和交流的方式已经越来越多样化。电话、邮件、短信、社交媒体应用等，使得人们可以从各种角度与朋友、家人、同事等联系。', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p>随着移动互联网的快速发展，人们使用手机和电脑联系和交流的方式已经越来越多样化。电话、邮件、短信、社交媒体应用等，使得人们可以从各种角度与朋友、家人、同事等联系。然而，这些手段有时解决不了一些需要快速协作和沟通的问题，比如企业内部联系人的管理、学校老师和学生之间的通讯录共享等。这时，多对一的通讯录就成为了必需品。本文将介绍如何利用PHP语言实现多对一的通讯录功能。</p>\n<p>&nbsp;</p>\n<p><strong>一. 通讯录的基本功能</strong></p>\n<ul>\n<li>\n<p>添加联系人：包括联系人的姓名、电话、邮箱、公司、职位等基本信息。</p>\n</li>\n<li>\n<p>编辑联系人：对已有联系人的信息进行修改。</p>\n</li>\n<li>\n<p>删除联系人：删除已有联系人的信息。</p>\n</li>\n<li>\n<p>按条件查找联系人：可以通过关键字或者类别等方式来查找已有的联系人。</p>\n</li>\n<li>\n<p>导出联系人：将通讯录的联系人信息导出为Excel或CSV格式存储在电脑或手机上供离线使用。</p>\n</li>\n<li>\n<p>备份通讯录：定期备份通讯录的联系人信息，防止数据丢失。</p>\n</li>\n</ul>\n<p>&nbsp;</p>\n<p><strong>二. 多对一通讯录的设计思路</strong></p>\n<p>在多对一的通讯录中，多个用户共享同一个通讯录的数据。为了保证数据的安全性和用户能够顺利访问通讯录，需要进行以下设计：</p>\n<ul>\n<li>\n<p>数据库的设计：利用关系型数据库存储通讯录的联系人信息并进行数据权限控制，防止未经授权的人员访问通讯录。</p>\n</li>\n<li>\n<p>用户认证：为了保证对通讯录的访问权限，需要在应用中添加用户认证功能。</p>\n</li>\n<li>\n<p>用户管理：建立一个用户管理界面，可以对用户的权限进行管理，以及对用户进行添加、修改和删除等操作。</p>\n</li>\n<li>\n<p>数据展示：从数据库中提取通讯录信息显示在页面上。可以通过搜索、分类、排序等方式实现通讯录中的信息管理。</p>\n</li>\n<li>\n<p>权限控制：根据不同用户的权限，控制用户可以看到的通讯录信息。</p>\n</li>\n</ul>\n<p>&nbsp;</p>\n<p><strong>三. 实现多对一通讯录的具体步骤</strong></p>\n<p>以下是实现多对一通讯录的具体步骤：</p>\n<ul>\n<li>\n<p>创建数据库并建立适当的表结构，包括用户表和联系人表等。</p>\n</li>\n<li>\n<p>开发用户认证功能和用户管理功能，采用常见的用户认证方式，比如用户名和密码认证等。</p>\n</li>\n<li>\n<p>开发联系人的添加、编辑和删除功能，并实现数据的有效性验证和存储。</p>\n</li>\n<li>\n<p>实现通讯录的筛选、排序、分类等功能。可以采用Ajax技术，提高用户体验。</p>\n</li>\n<li>\n<p>开发导出联系人和备份通讯录的功能。可以通过第三方软件或类库实现。</p>\n</li>\n<li>\n<p>实现权限控制功能，根据用户的权限将数据进行展示。</p>\n</li>\n</ul>\n<p>&nbsp;</p>\n<p><strong>四. 总结</strong></p>\n<p>本文介绍了如何利用PHP语言实现多对一的通讯录功能。一个好的通讯录应当具有方便、实用、安全等特点，更好的实现信息管理的需要。本文提供了一些设计思路和实现步骤，希望能够为PHP开发者提供帮助和启示。要想实现一个完整的多对一通讯录功能，还需要不断地学习和研究相关技术和工具，提高自己的编程能力和实践经验。</p>\n</body>\n</html>', 0, 0, 0, 1, 1, 1, 1, 1716170400, 1716170400, 1759389641);
INSERT INTO `Moq_article` (`id`, `cid`, `title`, `image`, `intro`, `content`, `browse`, `collect`, `sort`, `is_topping`, `is_recommend`, `is_show`, `is_delete`, `create_time`, `update_time`, `delete_time`) VALUES (6, 2, 'PHP如何实现不模糊包含表达式', 'static/default/images/article06.jpg', '不模糊包含表达式是指匹配字符串时必须完全匹配，而不是只匹配部分字符。在 PHP 中，可以使用 preg_match 函数来实现正则表达式匹配。', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p>不模糊包含表达式是指匹配字符串时必须完全匹配，而不是只匹配部分字符。在 PHP 中，可以使用 preg_match 函数来实现正则表达式匹配。</p>\n<p>&nbsp;</p>\n<p>例如，假设需要匹配的字符串为 \"hello world\"，则可以使用如下正则表达式：</p>\n<pre class=\"language-php\"><code>/^hello world$/</code></pre>\n<p>其中，^ 表示匹配字符串开头，$ 表示匹配字符串结尾。这样就可以确保只匹配完全相同的字符串，而不会模糊包含。</p>\n</body>\n</html>', 1, 0, 0, 1, 1, 1, 1, 1716170400, 1716170400, 1759389637);
INSERT INTO `Moq_article` (`id`, `cid`, `title`, `image`, `intro`, `content`, `browse`, `collect`, `sort`, `is_topping`, `is_recommend`, `is_show`, `is_delete`, `create_time`, `update_time`, `delete_time`) VALUES (7, 2, 'PHP中Linux文件路径是否存在怎么判断?', 'static/default/images/article07.jpg', 'php linux文件路径是否存在的判断方法：1、使用linux命令“[ -f qipa250.txt ] && echo yes || echo no”判断文件是否存在；2、通过php调用linux命令，代码是“$pdf_file_exists = \'[ -f \' . $pdf_file_url . \' ] && echo true || echo false\';”', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<blockquote>\n<p>php linux文件路径是否存在的判断方法：1、使用linux命令&ldquo;[ -f qipa250.txt ] &amp;&amp; echo yes || echo no&rdquo;判断文件是否存在；2、通过php调用linux命令，代码是&ldquo;$pdf_file_exists = \'[ -f \' . $pdf_file_url . \' ] &amp;&amp; echo true || echo false\';&rdquo;</p>\n</blockquote>\n<p>&nbsp;</p>\n<p>本教程操作环境：linux5.9.8系统、PHP8.1、Dell G3电脑。</p>\n<p><strong>php使用linux命令判断文件是否存在</strong></p>\n<p>Linux一句命令之判断文件是否存在</p>\n<pre class=\"language-php\"><code>[ -f qipa250.txt ] &amp;&amp; echo yes || echo no</code></pre>\n<p>-f 文件名字文件存在则为真。</p>\n<p>执行[ -f qipa250.txt ]为真则执行echo yes，由于或语句||的存在echo no不再执行。</p>\n<p>特别注意的是，这里的逻辑与和逻辑或值得仔细思考。</p>\n<p>php调用linux命令方法</p>\n<pre class=\"language-php\"><code>//指定文件路径\n\n$pdf_file_url=\'/data/web/QipaFile/qipa250.pdf\';\n\n//命令\n\n$pdf_file_exists = \'[ -f \' . $pdf_file_url . \' ] &amp;&amp; echo true || echo false\';\n\n//执行\n\necho $pdf_file_exists_result = system($pdf_file_exists);</code></pre>\n<p>&nbsp;</p>\n</body>\n</html>', 8, 0, 0, 1, 1, 1, 1, 1716170400, 1716170400, 1759389633);
INSERT INTO `Moq_article` (`id`, `cid`, `title`, `image`, `intro`, `content`, `browse`, `collect`, `sort`, `is_topping`, `is_recommend`, `is_show`, `is_delete`, `create_time`, `update_time`, `delete_time`) VALUES (8, 2, 'PHP中多态性是什么意思?', 'static/default/images/article08.jpg', '在PHP中，多态性是指同一个操作作用于不同的类的实例，将产生不同的执行结果。也即不同类的对象收到相同的消息时，将得到不同的结果；不同的对象，收到同一消息将可以产生不同的结果，这种现象称为多态性。多态性允许每个对象以适合自身的方式去响应共同的消息；多态性增强了软件的灵活性和重用性。', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<blockquote>\n<p>在PHP中，多态性是指同一个操作作用于不同的类的实例，将产生不同的执行结果。也即不同类的对象收到相同的消息时，将得到不同的结果；不同的对象，收到同一消息将可以产生不同的结果，这种现象称为多态性。多态性允许每个对象以适合自身的方式去响应共同的消息；多态性增强了软件的灵活性和重用性。</p>\n</blockquote>\n<p>&nbsp;</p>\n<h2><strong>PHP 多态性</strong></h2>\n<p>多态性是指相同的操作或函数、过程可作用于多种类型的对象上并获得不同的结果。不同的对象，收到同一消息将可以产生不同的结果，这种现象称为多态性。</p>\n<p>多态性允许每个对象以适合自身的方式去响应共同的消息。多态性增强了软件的灵活性和重用性。</p>\n<p>在面向对象的软件开发中，多态性是最为重要的部分之一。面向对象编程并不只是将相关的方法与数据简单的结合起来，而是采用面向对象编程中的各种要素将现实生活中的各种情况清晰的描述出来。这一小节将对面向对象编程中的多态性作详细的讲解。</p>\n<p>&nbsp;</p>\n<p><strong>1.什么是多态</strong></p>\n<p>多 态（Polymorphism）按字面上意思理解就是&ldquo;多种形状&rdquo;。可以理解为多种表现形式，也即&ldquo;一个对外接口，多个内部实现方法&rdquo;。在面向对象的理论 中，多态性的一般定义为：同一个操作作用于不同的类的实例，将产生不同的执行结果。也即不同类的对象收到相同的消息时，将得到不同的结果。</p>\n<p>在实际的应用开发中，采用面向对象中的多态主要在于可以将不同的子类对象都当作一个父类来处理，并且可以屏蔽不同子类对象之间所存在的差异，写出通用的代码，做出通用的编程，以适应需求的不断变化。</p>\n<p>&nbsp;</p>\n<p><strong>2. 多态的应用设计</strong></p>\n<p>在实际的应用开发中，通常为了使项目能够在以后的时间里的轻松实现扩展与升级，需要通过继承实现可复用模块进行轻松升级。在进行可复用模块设计时，就需要尽可能的减少使用流程控制语句。此时就可以采用多态实现该类设计。</p>\n</body>\n</html>', 65, 0, 0, 0, 1, 1, 1, 1716170400, 1716170400, 1759389631);
