INSERT INTO `Moq_dev_feature` (`id`, `type`, `title`, `desc`, `icon`, `sort`, `is_disable`, `create_time`, `update_time`) VALUES (1, '10', '智能客服', '无论凌晨还是节假日，智能客服全程在线，解答 Nike、AJ、椰子等鞋款尺码、库存、订单进度问题，10 秒内快速反馈，无需等待人工坐席，购物疑问即时解决。', 'fa-solid fa-yin-yang', 0, 0, 1741616005, 1758965199);
INSERT INTO `Moq_dev_feature` (`id`, `type`, `title`, `desc`, `icon`, `sort`, `is_disable`, `create_time`, `update_time`) VALUES (4, '10', '发货迅速', '覆盖全品牌鞋类的高效仓储体系，订单确认后优先处理，热门款如匡威、新百伦多仓就近调配，多数地区 48-72 小时送达，告别漫长等待。', 'fa-solid fa-bolt', 0, 0, 1758965249, 1758965249);
INSERT INTO `Moq_dev_feature` (`id`, `type`, `title`, `desc`, `icon`, `sort`, `is_disable`, `create_time`, `update_time`) VALUES (5, '10', 'AI 智能荐鞋', 'AI 助手基于你的浏览偏好、脚型数据、穿搭场景，从海量鞋款中筛选适配款式，无论是通勤选新百伦、潮搭选 AJ，都能快速找到心仪鞋品，避免选择困难。', 'fa-solid fa-arrow-up-right-dots', 0, 0, 1758965281, 1758965281);
INSERT INTO `Moq_dev_feature` (`id`, `type`, `title`, `desc`, `icon`, `sort`, `is_disable`, `create_time`, `update_time`) VALUES (6, '10', '售后保证', '购买所有鞋款 30 天质量问题免费售后，售后专员 1 对 1 跟进，解决质量瑕疵等问题，购物零风险。', 'fa-solid fa-hand-holding-droplet', 0, 0, 1758965399, 1758965399);
INSERT INTO `Moq_dev_feature` (`id`, `type`, `title`, `desc`, `icon`, `sort`, `is_disable`, `create_time`, `update_time`) VALUES (7, '10', '厂家直发', '与莆田多家厂家直接合作，订单由原厂仓库直接发货，无第三方转手，确保鞋品正品性，同时减少流通环节，价格更具优势。​', 'fa-solid fa-industry', 0, 0, 1758965493, 1758965493);
INSERT INTO `Moq_dev_feature` (`id`, `type`, `title`, `desc`, `icon`, `sort`, `is_disable`, `create_time`, `update_time`) VALUES (8, '10', '严选高品', '对所有上架鞋款执行 3 重质检标准，从鞋面材质、鞋底工艺到 logo 印刷逐一核查，确保鞋品符合原厂质量规范，穿着舒适耐穿，杜绝残次品。', 'fa-solid fa-baby-carriage', 0, 0, 1758965546, 1758965546);
INSERT INTO `Moq_dev_feature` (`id`, `type`, `title`, `desc`, `icon`, `sort`, `is_disable`, `create_time`, `update_time`) VALUES (9, '20', '网站上的鞋子是正品吗，会不会买到高仿或翻新货？', '一分钱一分货～', 'fa-solid fa-apple-whole', 0, 0, 1758965702, 1758965702);
INSERT INTO `Moq_dev_feature` (`id`, `type`, `title`, `desc`, `icon`, `sort`, `is_disable`, `create_time`, `update_time`) VALUES (10, '20', '商品图片和实物差距大吗？', '不同品质的鞋子质感都不一样，具体可以咨询客服！', 'fa-solid fa-apple-whole', 0, 0, 1758965746, 1758965746);
INSERT INTO `Moq_dev_feature` (`id`, `type`, `title`, `desc`, `icon`, `sort`, `is_disable`, `create_time`, `update_time`) VALUES (11, '20', '尺码标准吗？不同品牌（如匡威、新百伦）的尺码会不会有偏差，买错了不好退换？', '尺码基本一致，所以无需担心。', 'fa-solid fa-apple-whole', 0, 0, 1758965797, 1758965797);
INSERT INTO `Moq_dev_feature` (`id`, `type`, `title`, `desc`, `icon`, `sort`, `is_disable`, `create_time`, `update_time`) VALUES (12, '20', '支付方式安全吗？用微信、支付宝或银行卡付款，会不会泄露个人信息或遭遇盗刷？', '不必担心，本站的支付方式都是对接微信/支付宝官方完成，完全没有安全问题。', 'fa-solid fa-bag-shopping', 0, 0, 1758965857, 1758965857);
