  `rules` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '运行规则',
  `concurrent` tinyint unsigned NOT NULL DEFAULT '1' COMMENT '并发数量',
  `remarks` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '' COMMENT '备注信息',
  `error` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '错误提示',
  `status` tinyint unsigned NOT NULL DEFAULT '1' COMMENT '执行状态: [1=运行, 2=暂停, 3=错误]',
  `exe_time` int unsigned NOT NULL DEFAULT '0' COMMENT '执行时长',
  `max_time` int unsigned NOT NULL DEFAULT '0' COMMENT '最大执行时长',
  `last_time` int unsigned NOT NULL DEFAULT '0' COMMENT '最后执行时间',
  `is_delete` int unsigned NOT NULL DEFAULT '0' COMMENT '是否删除: [0=否, 1=是]',
  `create_time` int unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `delete_time` int unsigned NOT NULL DEFAULT '0' COMMENT '删除时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=DYNAMIC COMMENT='系统任务表';

